prepareYTVideo(e, t) ;{
    const i = this.getElementSettings();
    const o = {
        videoId: this.videoID,
        events: {
            onReady: () => {
                if (i.mute) this.youtubePlayer.mute();
                if (i.autoplay || t) this.youtubePlayer.playVideo();
            },
            onStateChange: t => {
                if (t.data === e.PlayerState.ENDED && i.loop) {
                    this.youtubePlayer.seekTo(i.start || 0);
                }
            }
        },
        playerVars: {
            controls: i.controls ? 1 : 0,
            rel: i.rel ? 1 : 0,
            playsinline: i.play_on_mobile ? 1 : 0,
            modestbranding: i.modestbranding ? 1 : 0,
            autoplay: i.autoplay ? 1 : 0,
            start: i.start,
            end: i.end
        }
    };
    if (i.yt_privacy) {
        o.host = "https://www.youtube-nocookie.com";
        o.origin = window.location.hostname;
    }
    this.youtubePlayer = new e.Player(this.elements.$video[0], o);
}